def yolo_loss(y_true, y_pred):
    # Implementacin bsica de la funcin de prdida de YOLO
    # Debe considerar la prdida de las coordenadas, la confianza y la clasificacin
    return tf.reduce_sum(tf.square(y_true - y_pred))  # Simplificacin extrema

